import React, { Component } from "react";

export default class ProcessingBill extends Component {
  componentDidMount() {
    console.log("props" + JSON.stringify(this.props));
  }
  render() {
    return (
      <div className="mb-3">
        <span className="material-icons text-warning text-gradient">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width={16}
            height={16}
            fill="currentColor"
            className="bi bi-bell"
            viewBox="0 0 16 16"
          >
            <path d="M8 16a2 2 0 0 0 2-2H6a2 2 0 0 0 2 2zM8 1.918l-.797.161A4.002 4.002 0 0 0 4 6c0 .628-.134 2.197-.459 3.742-.16.767-.376 1.566-.663 2.258h10.244c-.287-.692-.502-1.49-.663-2.258C12.134 8.197 12 6.628 12 6a4.002 4.002 0 0 0-3.203-3.92L8 1.917zM14.22 12c.223.447.481.801.78 1H1c.299-.199.557-.553.78-1C2.68 10.2 3 6.88 3 6c0-2.42 1.72-4.44 4.005-4.901a1 1 0 1 1 1.99 0A5.002 5.002 0 0 1 13 6c0 .88.32 4.2 1.22 6z" />
          </svg>
        </span>
        <div className="timeline-content">
          <h6 className="text-dark text-sm font-weight-bold mb-0">
            {
              this.props.bill.chitiethoadons.$values[0].imeiNavigation
                .masanphamNavigation.tensanpham
            }
            , số lượng: {this.props.bill.chitiethoadons.$values[0].soluong}
          </h6>
          <h6 className="text-success text-sm font-weight-bolder">
            Đơn giá:{" "}
            {this.props.bill.chitiethoadons.$values[0].imeiNavigation
              .masanphamNavigation.dongia *
              this.props.bill.chitiethoadons.$values[0].soluong}
          </h6>
          <h6 className="text-success text-sm font-weight-bolder">
            {this.props.bill.makhachhangNavigation.tenkhachhang},{" "}
            {this.props.bill.makhachhangNavigation.sodienthoai}
          </h6>
          <p className="text-secondary font-weight-bold text-xs mt-1 mb-0">
            {this.props.bill.ngayhoadon}
          </p>
        </div>
      </div>
    );
  }
}
